import React, { useState } from 'react';
import { Formik, Field, Form } from 'formik';
import * as Yup from 'yup';
import axios from 'axios';

// Custom input component
const InputField = ({ field, form, ...props }) => {
  return (
    <div>
      <input {...field} {...props} />
      {form.touched[field.name] && form.errors[field.name] && (
        <div style={{ color: 'red' }}>{form.errors[field.name]}</div>
      )}
    </div>
  );
};

const RegisterBusiness = () => {
  const [files, setFiles] = useState({
    businessRegistration: null,
    tradeLicense: null,
    foodLicense: null,
    fireSafetyCertificate: null,
    healthSanitationLicense: null,
    gstRegistration: null,
    liquorLicense: null,
    pestControlCertificate: null,
  });

  const initialValues = {
    businessRegistration: null,
    tradeLicense: null,
    foodLicense: null,
    fireSafetyCertificate: null,
    healthSanitationLicense: null,
    gstRegistration: null,
    liquorLicense: null,
    pestControlCertificate: null,
  };

  const validationSchema = Yup.object({
    businessRegistration: Yup.mixed().required('Business Registration file is required'),
    tradeLicense: Yup.mixed().required('Trade License file is required'),
    foodLicense: Yup.mixed().required('Food License file is required'),
    fireSafetyCertificate: Yup.mixed().required('Fire Safety Certificate file is required'),
    healthSanitationLicense: Yup.mixed().required('Health and Sanitation License file is required'),
    gstRegistration: Yup.mixed().required('GST Registration file is required'),
    liquorLicense: Yup.mixed().required('Liquor License file is required'),
    pestControlCertificate: Yup.mixed().required('Pest Control Certificate file is required'),
  });

  const handleFileChange = (event, fieldName) => {
    setFiles({ ...files, [fieldName]: event.target.files[0] });
  };

  const handleSubmit = async (values, { setSubmitting, setStatus }) => {
    // You can use FormData to send the files as part of the request
    const formData = new FormData();
    Object.keys(files).forEach((key) => {
      if (files[key]) formData.append(key, files[key]);
    });

    try {
      const response = await axios.post('http://localhost:5000/api/owners/register', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });
      setStatus({ success: 'Registration successful!' });
    } catch (error) {
      const message = error.response?.data?.error || 'Registration failed. Please try again.';
      setStatus({ error: message });
    }
    setSubmitting(false);
  };

  return (
    <div>
      <h2>Register Your Marriage Mahal Business</h2>

      <Formik
        initialValues={initialValues}
        validationSchema={validationSchema}
        onSubmit={handleSubmit}
      >
        {({ isSubmitting, status }) => (
          <Form>
            {status?.error && <p style={{ color: 'red' }}>{status.error}</p>}
            {status?.success && <p style={{ color: 'green' }}>{status.success}</p>}

            <div>
              <h3>Upload Required Documents</h3>

              {/* File Uploads for Each Certificate */}
              <div>
                <label>Business Registration</label>
                <Field
                  name="businessRegistration"
                  type="file"
                  onChange={(e) => handleFileChange(e, 'businessRegistration')}
                />
              </div>

              <div>
                <label>Trade License</label>
                <Field
                  name="tradeLicense"
                  type="file"
                  onChange={(e) => handleFileChange(e, 'tradeLicense')}
                />
              </div>

              <div>
                <label>Food License</label>
                <Field
                  name="foodLicense"
                  type="file"
                  onChange={(e) => handleFileChange(e, 'foodLicense')}
                />
              </div>

              <div>
                <label>Fire Safety Certificate</label>
                <Field
                  name="fireSafetyCertificate"
                  type="file"
                  onChange={(e) => handleFileChange(e, 'fireSafetyCertificate')}
                />
              </div>

              <div>
                <label>Health and Sanitation License</label>
                <Field
                  name="healthSanitationLicense"
                  type="file"
                  onChange={(e) => handleFileChange(e, 'healthSanitationLicense')}
                />
              </div>

              <div>
                <label>GST Registration</label>
                <Field
                  name="gstRegistration"
                  type="file"
                  onChange={(e) => handleFileChange(e, 'gstRegistration')}
                />
              </div>

              <div>
                <label>Liquor License</label>
                <Field
                  name="liquorLicense"
                  type="file"
                  onChange={(e) => handleFileChange(e, 'liquorLicense')}
                />
              </div>

              <div>
                <label>Pest Control Certificate</label>
                <Field
                  name="pestControlCertificate"
                  type="file"
                  onChange={(e) => handleFileChange(e, 'pestControlCertificate')}
                />
              </div>

              <button type="submit" disabled={isSubmitting}>
                Submit
              </button>
            </div>
          </Form>
        )}
      </Formik>
    </div>
  );
};

export default RegisterBusiness;
